import React from "react";

import projectList from "../ProjectList";

import ProjectDetail from "../components/Work/WorkItem/ProjectDetail";
import LargeBox from "../components/Work/WorkItem/ImageBox/LargeBox";
import MediumBox from "../components/Work/WorkItem/ImageBox/MediumBox";
import UpMargin from "../components/Assets/UpMargin";
import ProjectDesc from "../components/Work/WorkItem/ProjectDesc";
import MediumLongBox from "../components/Work/WorkItem/ImageBox/MediumLongBox";

const Bokdda = () => {
  const bokdda = projectList[1];
  return (
    <section className="container">
      <LargeBox background="https://i.imgur.com/QPNqqhO.png" />
      <ProjectDetail
        title={bokdda.title}
        company={bokdda.company}
        year={bokdda.year}
        details={bokdda.details}
        role={bokdda.role}
        goal={bokdda.goal}
      />
      <UpMargin />
      <MediumLongBox />
      <ProjectDesc
        title="Problem"
        desc="재난지원금을 신청하면서 복지에 대해 알아보다 지원받을 수 있는 복지사업이 많다는 걸 알게 되었습니다. 그래서 다른 복지를 신청하려고 보니, 신청 자격을 알아보고 서류를 준비해서 접수하는 과정이 불편했습니다.

그동안 국가에서 운영하던 '복지로'라는 포털에서는 복지 검색만 지원하는 한계가 있었고, 복지를 신청하기 위해서 2개 이상의 서비스를 이용해야 하는 불편함이 존재했습니다.

그래서 다른 사람들도 같은 문제를 느끼고 있는가를 확인하고자 간단한 서비스 소개가 들어간 사전예약 페이지를 만들어 5일간 평가했습니다.
결과적으로 예상보다 확연하게 낮은 200원 정도의 CAC가 나왔고, 그동안 복지 서비스를 신청해본 입장에서 복지 검색과 신청 과정의 불편함을 해결하고 싶었습니다."
      />
      <LargeBox background="https://i.imgur.com/QPNqqhO.png" />

      <ProjectDesc
        title="Approach"
        desc="Contrary to popular belief, Lorem Ipsum is not simply random text. It
          has roots in a piece of classical Latin literature from 45 BC, making
          it over 2000 years old. Richard McClintock, a Latin professor at
          Hampden-Sydney College in Virginia, looked up one of the more obscure"
      />
      <LargeBox background="https://i.imgur.com/QPNqqhO.png" />
      <div className="box_area">
        <MediumBox background="https://i.imgur.com/f71RFmr.png" />
        <ProjectDesc
          title="Solution"
          desc="Contrary to popular belief, Lorem Ipsum is not simply random text. It
          has roots in a piece of classical Latin literature from 45 BC, making
          it over 2000 years old. Richard McClintock, a Latin professor at
          Hampden-Sydney College in Virginia, looked up one of the more obscure"
        />
      </div>
    </section>
  );
};

export default Bokdda;
